import React from "react";
import { ReactComponent as Previous } from '../../icons/previous.svg';

export default function Row({ song }) {
  return (
    <div key={song.id} className="Song">
      <button className='prev'><Previous className="Icon" /></button>
      {song.title}
    </div>
  )
}
